import React from 'react';
import Layout from './Layout';
import { getProduct } from './apiCore';



const Home = () => {
return(
    <Layout title ="Home Page" discreption = "This is the Home page for Ecommerce website ">
    {getProduct('sold')}
    </Layout>
);
}
export default Home;
